import React from "react";
import { Form } from "react-bootstrap";
import "./Filter.css";

const Filter = ({ handleChange }) => {
  return (
    <form>
      <input
        type="checkbox"
        id="diet1"
        name="diet"
        value="Standard"
        onChange={handleChange}
      ></input>
      <label for="diet"> Standard</label>
      <input
        type="checkbox"
        id="diet2"
        name="diet"
        value="Vegetarian"
        onChange={handleChange}
      ></input>
      <label for="diet"> Vegetarian</label>
      <input
        type="checkbox"
        id="diet1"
        name="diet"
        value="Vegan"
        onChange={handleChange}
      ></input>
      <label for="diet"> Vegan</label>
    </form>
  );
};

export default Filter;
